struct _celula {
  int tipo;

  struct _celula *esq;
  struct _celula *dir;
};
typedef struct _celula celula;
typedef celula *Celula;

celula heap[N] = {};
celula referencias[NUMERO_REFERENCIAS] = {{K, NULL, NULL}, {S, NULL, NULL}};
Celula pilha[N] = {};
int pilha_p = 0;
int index_criacao = 0;

void imprime(int v) {
  switch (v) {
  case AP:
    printf("(");
    break;
  case FP:
    printf(")");
    break;
  case K:
    printf("K");
    break;
  case S:
    printf("S");
    break;
  case app:
    printf("@");
    break;
  case fim_string:
    printf(";");
    break;
  default:
    printf("%d", v);
  }
}

void mostraArvore(Celula a, int b) {
  if (a == NULL)
    return;
  if (a->esq != NULL) {
    printf("[");
    mostraArvore(a->esq, b + 1);
    printf("] <- ");
  } else
    printf("(");
  imprime(a->tipo);
  if (a->dir != NULL) {
    printf(" -> [");
    mostraArvore(a->dir, b + 1);
    printf("]");
  } else
    printf(")");
}

void mostraHeap() {
  for(int i=0 ; i<N ; i++) {
    if(heap[i].tipo != 0) {
      imprime(heap[i].tipo);
    }
  }
}

Celula cria_celula(int tipo, Celula esq, Celula dir) {
  // printf("%d\n",tipo);
  heap[index_criacao].tipo = tipo;
  heap[index_criacao].esq = esq;
  heap[index_criacao].dir = dir;
  return &heap[index_criacao++];
}

Celula apontar_referencia(int valor) {
  for (int i = 0; i < NUMERO_REFERENCIAS; i++) {
    if (referencias[i].tipo == valor) {
      heap[index_criacao] = referencias[i];
      return &heap[index_criacao++];
    }
  }
  // Caso seja um valor e não um token esperado
  return cria_celula(valor, NULL, NULL);
}

Celula cria_grafo(int *codigo) {
  int index = 0;
  int valor;
  Celula aux;
  pilha_p = 0;

  Celula atual = cria_celula(app, NULL, NULL);

  //enquanto não chegar no fim da string
  while (codigo[index] != fim_string) {
    //Armazena o valor do index
    valor = codigo[index];

    switch (valor) {
    case AP:
      pilha[pilha_p++] = atual;
      atual = cria_celula(app, NULL, NULL);
      break;

    case FP:
      // aux = cria_celula(app, pilha[pilha_p--], atual);
      pilha_p--;
      pilha[pilha_p]->dir = atual;
      atual = pilha[pilha_p];
      break;

    default:
    //checa se o valor e nulo
      if (atual == NULL) {
        atual = apontar_referencia(codigo[index]);
        break;
      }

      if (atual->tipo == app) {
        if (atual->esq == NULL) {
          atual->esq = apontar_referencia(codigo[index]);
          break;
        } else if (atual->dir == NULL) {
          atual->dir = apontar_referencia(codigo[index]);
          break;
        }
      }

      Celula ref = apontar_referencia(codigo[index]);
      aux = cria_celula(app, atual, ref);
      atual = aux;
    }

    index++;
  }

  return atual;
}

Celula reduz_k() {
  // K a b => a
  Celula a = pilha[--pilha_p]->dir;
  Celula b = pilha[--pilha_p]->dir;
  pilha[--pilha_p]->esq = a;
  return a;
}

Celula reduz_s() {
  // S a b c => a c ( b c )
  Celula a = pilha[--pilha_p]->dir;
  Celula b = pilha[--pilha_p]->dir;
  Celula c = pilha[--pilha_p]->dir;

  Celula Sesq = cria_celula(app, a, c);
  Celula Sdir = cria_celula(app, b, c);
  Celula Sroot = cria_celula(app, Sesq, Sdir);
  pilha_p -= 1;
  return Sroot;
}

Celula aplicar_reducao(Celula cell) {
  pilha_p = 0;
  Celula atual = cria_celula(app, cell, NULL), aux;

  pilha[pilha_p++] = atual;
  while (pilha_p > 0) {
    if (atual->esq == NULL) {
      switch (atual->tipo) {
      case K:
        if (pilha_p <= 2)
          return pilha[1];
        atual = reduz_k();
        break;
      case S:
        if (pilha_p <= 3)
          return pilha[1];
        atual = reduz_s();
        break;

      default:
        return pilha[1];
      }
    } else {
      aux = atual->esq;
      pilha[pilha_p++] = atual;
      atual = aux;
    }
  }
  return pilha[pilha_p];
}

